import React, { Component } from 'react';
import { Link } from "react-router-dom";

class Footer extends Component {
    render() {
        return (
            <div>
                <div className="socialMediaBox">
                    <div className="container">
                        <p>FOLLOW US ON</p>
                        <Link to="" className="socialMedia"><i className="fab fa-facebook-f"></i></Link>
                        <Link to="" className="socialMedia"><i className="fab fa-twitter"></i></Link>
                        <Link to="" className="socialMedia"><i className="fab fa-google-plus-g"></i></Link>
                        <Link to="" className="socialMedia"><i className="fab fa-instagram"></i></Link>
                        <Link to="" className="socialMedia"><i className="fab fa-pinterest"></i></Link>
                    </div>
                </div>
                <div className="container">

                </div>
                <div className="navbar navbar-expand-sm">
                    <div className="container">
                        <ul className="navbar-nav">
                            <li className="nav-item">Â© 2018 Gretongan</li>
                            <li className="nav-item"></li>
                            <li className="nav-item"><Link to="/delivery-information">Delivery Information</Link></li>
                        </ul>
                    </div>
                </div>
            </div>
        );
    }
}

export default Footer;
